int16_t output[HEIGHT][WIDTH];

int sobel_x[3][3] = {
    {-1, 0, 1},
    {-2, 0, 2},
    {-1, 0, 1}
};

int sobel_y[3][3] = {
    {-1, -2, -1},
    { 0,  0,  0},
    { 1,  2,  1}
};

void app_main() {
    for (int y = 1; y < HEIGHT - 1; y++) {
        for (int x = 1; x < WIDTH - 1; x++) {
            int gx = 0, gy = 0;
            for (int j = -1; j <= 1; j++) {
                for (int i = -1; i <= 1; i++) {
                    gx += image[y + j][x + i] * sobel_x[j + 1][i + 1];
                    gy += image[y + j][x + i] * sobel_y[j + 1][i + 1];
                }
            }
            output[y][x] = sqrt(gx * gx + gy * gy);
        }
    }

    // Imprimir resultado
    for (int y = 0; y < HEIGHT; y++) {
        for (int x = 0; x < WIDTH; x++) {
            printf("%d ", output[y][x]);
        }
        printf("\n");
    }
}
